CREATE DATABASE AIRLINE_DATA_ANALYSIS;
USE AIRLINE_DATA_ANALYSIS;

CREATE TABLE Passengers (
 passenger_id INT PRIMARY KEY, first_name VARCHAR(50), last_name VARCHAR(50), gender VARCHAR(10), dob DATE, email VARCHAR(100)
);

CREATE TABLE Airports (
 airport_code VARCHAR(10) PRIMARY KEY, airport_name VARCHAR(100), city VARCHAR(50), country VARCHAR(50)
);

CREATE TABLE Flights (
 flight_id INT PRIMARY KEY, airline VARCHAR(100), origin VARCHAR(10), destination VARCHAR(10), departure_time DATETIME, arrival_time DATETIME, status VARCHAR(20),
 FOREIGN KEY (origin) REFERENCES Airports(airport_code), FOREIGN KEY (destination) REFERENCES Airports(airport_code)
);

CREATE TABLE Tickets (
 ticket_id INT PRIMARY KEY, flight_id INT, passenger_id INT, seat_class VARCHAR(20), price DECIMAL(10, 2), booking_date DATE, payment_status VARCHAR(20),
 FOREIGN KEY (flight_id) REFERENCES Flights(flight_id), FOREIGN KEY (passenger_id) REFERENCES Passengers(passenger_id)
);

CREATE TABLE Crew (
 crew_id INT PRIMARY KEY, name VARCHAR(100), role VARCHAR(50), flight_id INT, FOREIGN KEY (flight_id) REFERENCES Flights(flight_id)
);

CREATE TABLE Delays (
 delay_id INT PRIMARY KEY, flight_id INT, delay_minutes INT, reason VARCHAR(50), FOREIGN KEY (flight_id) REFERENCES Flights(flight_id)
);

